import React, { Card } from "react";

const ProductList = (props) => {
  const products = [
    {
      id: 1,
      name: "Master Mask",
      price: "20USD",
      brand: "Maskus",
    },
    {
      id: 2,
      name: "Mask deluxe",
      price: "35USD",
      brand: "My masks",
    },
    {
      id: 3,
      name: "Covid Saver",
      price: "40USD",
      brand: "Maskid",
    },
    {
      id: 4,
      name: "Ferme la bouche",
      price: "15USD",
      brand: "Tancala",
    },
  ];

  const productList = products.map((product) => <li>{product.name}</li>);

  return <div>{productList}</div>;
};

export default ProductList;
